x1 = x1(:,aaa);
[a_n,b_n,resub] = LDA( x0,x1)
figure;
plot(x0(:,1),x0(:,2),'o','MarkerEdgeColor','k','MarkerSize',5);
hold on;
plot(x1(:,1),x1(:,2),'^','MarkerEdgeColor','k','MarkerSize',7);
xlabel('Gsr');
ylabel('Lpcat3');

range = [min([x0(:,1);x1(:,1)])-10 max([x0(:,1);x1(:,1)])+10];
x11 = linspace(range(1),range(2),1000);
%x11 = linspace(80,240,1000); %leave commented out
x22 = (-b_n-a_n(1)*x11)/a_n(2);
plot(x11,x22,'k');
% end of 2-D plot---------------------------------------

